// import './App.css';
import Home from './Home';
import Navbar from './Navbar';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {

  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className="container">
          <switch>
            <Route path='/'>
              <Home />
            </Route>
          </switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
